  //       <DailytimeBudget key={ctrl.activity} hours={ctrl.totalHours} />
  //     ))}
  //   </div>
  //   )
  // }
  // }

  render() {
    let thisWeek = new DailyTimeBudget();
    let thisWeek2 = { ...thisWeek };
    let Monday = thisWeek2.Monday;
    console.log(Monday.hoursInDay);
    return (
      <div>
        <p>Hi this is WeeklyTimeBudget {thisWeek.Monday.hoursInDay}</p>
      </div>
    );
  }
}

export default weeklyTimeBudget;

